import React, { Component } from "react";
import "../LoginStyle.scss";

export class Profiling extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>Hi ,</h1>
        <form>
          <label htmlFor="savingsList">Savings Account : </label>
          <input list="savings" id="savingsList"></input>
          <datalist id="savings">
            <option id="ocbc">OCBC</option>
            <option id="dbs">DBS</option>
          </datalist>
          <br />
          <label htmlFor="stocksList">Stocks : </label>
          <input list="stocks" id="stocksList"></input>
          <datalist id="stocks">
            <option id="amazon">Amazon</option>
            <option id="apple">Apple</option>
          </datalist>
        </form>
      </div>
    );
  }
}
